Movie Info: Mr Joe B. Carvalho is a Bollywood comedy film which released on January 3, 2014. The film is directed by Samir Tewari, and produced by Shital Malviya and Bhola Ram Malviya (Arshad Warsi's long standing secretary). The film stars Arshad Warsi, Soha Ali Khan, Javed Jaffrey and Vijay Raaz. The first teaser of the film was released on November 17, 2013. The film also has guest appearances by Geeta Basra and Karishma Kotak. Singer Babul Supriyo debuts in the film by playing a cameo.


